from typing import List
from collections import defaultdict
import datetime

class WeightedUnionFind:

    def __init__(self, size):
        self.node = [i for i in range(size)]
        self.size = [1] * size
        self.count = size
        pass

    def find(self, p: int):
        while self.node[p] != p:
            p = self.node[p]
        return p

    def union(self, p: int, q: int):
        p = self.find(p)
        q = self.find(q)
        if p == q:
            return
        if self.size[p] < self.size[q]:
            self.node[p] = q
            self.size[q] = self.size[q] + self.size[p]
        else:
            self.node[q] = p
            self.size[p] = self.size[q] + self.size[p]
        self.count -= 1


class Solution:
    def __init__(self):
        self.t1 = datetime.datetime.now()

    def print_time(self):
        if True:
            print(datetime.datetime.now() - self.t1)

    def countSubIslands(self, grid1: List[List[int]], grid2: List[List[int]]) -> int:
        self.print_time()
        m, n = len(grid1), len(grid1[0])
        wuf1, wuf2 = WeightedUnionFind(m * n), WeightedUnionFind(m * n)
        self.print_time()
        for i in range(m):
            for j in range(n):
                if grid1[i][j] == 1:
                    if i > 0 and grid1[i - 1][j] == 1:
                        wuf1.union(n * i + j, n * (i - 1) + j)
                    if j > 0 and grid1[i][j - 1] == 1:
                        wuf1.union(n * i + j, n * i + (j - 1))
                if grid2[i][j] == 1:
                    if i > 0 and grid2[i - 1][j] == 1:
                        wuf2.union(n * i + j, n * (i - 1) + j)
                    if j > 0 and grid2[i][j - 1] == 1:
                        wuf2.union(n * i + j, n * i + (j - 1))
        print(wuf2.count, wuf1.count)
        self.print_time()
        islands2 = defaultdict(lambda: set[int]())
        not_sub_island = set[int]()
        is_sub_island = set[int]()
        for i in range(m):
            for j in range(n):
                if grid2[i][j] == 1:
                    islands2_key = wuf2.find(i * n + j)
                    is_sub_island.add(islands2_key)
                    if grid1[i][j] == 0:
                        not_sub_island.add(islands2_key)
                    else:
                        islands1_key = wuf1.find(i * n + j)
                        islands2[islands2_key].add(islands1_key)
                        if len(islands2[islands2_key]) > 1:
                            not_sub_island.add(islands2_key)

        self.print_time()
        return len(is_sub_island) - len(not_sub_island)

